import React from 'react';
import NotFoundContent from './NotFoundContent';
import './NotFound.css';
import notFoundImage from '../assets/images/notfound.png'; // Патеката до сликата

const NotFound = () => {
  return (
    <NotFoundContent
      text="404"
      imageSrc={notFoundImage}
      linkText="Retourner sur la page d’accueil"
      linkUrl="/"
    />
  );
};

export default NotFound;
